  CREATE OR REPLACE FORCE VIEW "KYAMC_MCMS"."NMV_APPLICATION" ("APPLICATION_ID", "SESSION_ID", "SESSION_NAME", "APPLICATION_SL", "COURSE_ID", "COURSE_NAME", "BATCH_MAP_ID", "BATCH_NAME", "POLICYMST_ID", "POLICYMST_NAME", "FULL_NAME_ENG", "FULL_NAME_BNG", "BIRTH_DATE", "GENDER", "BLOOD_GROUP", "MARITAL_STATUS", "MOBILE_NUMBER", "EMAIL_ADDRESS", "NATIONALITY", "RELIGION", "APPLICANT_PHOTO", "APPLICANT_SIGN", "APPLICANT_SIGN_DATE", "REGISTRATION_NUMBER", "ROLL_NUMBER", "EXAM_DATE", "COLLEGE_CODE", "MERIT_POSITION", "FATHER_NAME_ENG", "FATHER_NAME_BNG", "FATHER_MOBILE", "FATHER_EMAIL", "FATHER_OCCU_ID", "FATHER_OCCUPATION", "MOTHER_NAME_ENG", "MOTHER_NAME_BNG", "MOTHER_MOBILE", "MOTHER_EMAIL", "MOTHER_OCCU_ID", "MOTHER_OCCUPATION", "GUARDIAN_SIGN", "GUARDIAN_SIGN_DATE", "LG_NAME", "LG_DETAILS", "LG_OCCU_ID", "LG_OCCUPATION", "LG_MOBILE", "LG_EMAIL", "LG_VILLAGE", "LG_POST_OFFICE", "LG_UPAZILLA", "LG_DISTRICT", "RELATION_WITH_LG", "PRE_VILLAGE", "PRE_POST_OFFICE", "PRE_UPAZILLA", "PRE_DISTRICT", "PRE_MOBILE", "PER_VILLAGE", "PER_POST_OFFICE", "PER_MOBILE", "PER_UPAZILLA", "PER_DISTRICT", "EDU_QUALI_ID", "ACTIVE_FLAG", "ENTERED_BY", "ENTRY_TIMESTAMP", "UPDATED_BY", "UPDATE_TIMESTAMP", "COMPANY_NO", "RELIGION_NO", "RELIGION_NAME", "APPLICANT_PHOTO_PATH", "APPLICANT_SIGN_PATH", "ADDRESS_TYPE", "LOCAL_GUARDIAN_FG", "QUOTA_ID", "QUOTA_NAME") AS 
  SELECT 
  A.APPLICATION_ID,
  A.SESSION_ID,
  (SELECT S.SESSION_NAME FROM NM_SESSION S WHERE A.SESSION_ID=S.SESSION_ID) SESSION_NAME,
  A.APPLICATION_SL,
  A.COURSE_ID,
  (SELECT C.COURSE_NAME FROM NM_COURSE C WHERE A.COURSE_ID=C.COURSE_ID) COURSE_NAME,
  A.BATCH_MAP_ID,
  (SELECT B.BATCH_NAME FROM NM_BATCH_MAP B WHERE A.BATCH_MAP_ID=B.BATCH_MAP_ID) BATCH_NAME,
  A.POLICYMST_ID,
  (SELECT P.POLICYMST_NAME FROM NM_POLICYMST P WHERE A.POLICYMST_ID=P.POLICYMST_ID) POLICYMST_NAME,
  A.FULL_NAME_ENG,
  A.FULL_NAME_BNG,
  A.BIRTH_DATE,
  A.GENDER,
  A.BLOOD_GROUP,
  A.MARITAL_STATUS,
  A.MOBILE_NUMBER,
  A.EMAIL_ADDRESS,
  A.NATIONALITY,
  A.RELIGION,
  A.APPLICANT_PHOTO,
  A.APPLICANT_SIGN,
  A.APPLICANT_SIGN_DATE,
  A.REGISTRATION_NUMBER,
  A.ROLL_NUMBER,
  A.EXAM_DATE,
  A.COLLEGE_CODE,
  A.MERIT_POSITION,
  A.FATHER_NAME_ENG,
  A.FATHER_NAME_BNG,
  A.FATHER_MOBILE,
  A.FATHER_EMAIL,
  A.FATHER_OCCU_ID,
  (SELECT O.OCCUPATION_NAME_ENG FROM NM_OCCUPATION O WHERE A.FATHER_OCCU_ID=O.OCCUPATION_ID) FATHER_OCCUPATION,
  A.MOTHER_NAME_ENG,
  A.MOTHER_NAME_BNG,
  A.MOTHER_MOBILE,
  A.MOTHER_EMAIL,
  A.MOTHER_OCCU_ID,
  (SELECT O.OCCUPATION_NAME_ENG FROM NM_OCCUPATION O WHERE A.MOTHER_OCCU_ID=O.OCCUPATION_ID) MOTHER_OCCUPATION,
  A.GUARDIAN_SIGN,
  A.GUARDIAN_SIGN_DATE,
  A.LG_NAME,
  A.LG_DETAILS,
  A.LG_OCCU_ID,
  (SELECT O.OCCUPATION_NAME_ENG FROM NM_OCCUPATION O WHERE A.LG_OCCU_ID=O.OCCUPATION_ID) LG_OCCUPATION,
  A.LG_MOBILE,
  A.LG_EMAIL,
  A.LG_VILLAGE,
  A.LG_POST_OFFICE,
  A.LG_UPAZILLA,
  A.LG_DISTRICT,
  A.RELATION_WITH_LG,
  A.PRE_VILLAGE,
  A.PRE_POST_OFFICE,
  A.PRE_UPAZILLA,
  A.PRE_DISTRICT,
  A.PRE_MOBILE,
  A.PER_VILLAGE,
  A.PER_POST_OFFICE,
  A.PER_MOBILE,
  A.PER_UPAZILLA,
  A.PER_DISTRICT,
  A.EDU_QUALI_ID,
  A.ACTIVE_FLAG,
  A.ENTERED_BY,
  A.ENTRY_TIMESTAMP,
  A.UPDATED_BY,
  A.UPDATE_TIMESTAMP,
  A.COMPANY_NO,
  A.RELIGION_NO,
  (SELECT R.RELIGION_NAME FROM HR_RELIGION R WHERE A.RELIGION_NO=R.RELIGION_NO) RELIGION_NAME,
  A.APPLICANT_PHOTO_PATH,
  A.APPLICANT_SIGN_PATH,
  A.ADDRESS_TYPE,
  A.LOCAL_GUARDIAN_FG,
  A.QUOTA_ID,
  (SELECT Q.QUOTA_NAME FROM NM_QUOTA Q WHERE A.QUOTA_ID=Q.QUOTA_ID) QUOTA_NAME
  FROM NM_APPLICATION A
;
