--  DDL for Trigger TRG_FEEHEAD
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "KYAMC_MCMS"."TRG_FEEHEAD" 
   AFTER INSERT OR UPDATE OR DELETE
   ON NM_FEEHEAD    FOR EACH ROW
BEGIN


   IF INSERTING THEN
      insert INTO dc_testmst(TEST_NO,
                                USER_DEFINE_TEST_NO,
                                TEST_NAME,
                                RATE,
                                SERVICE_TYPE,
                                VAT_APPLICABLE,
                                ACTIVE_STATUS)
                                
       values(:NEW.FEEHEAD_ID,
                 :NEW.FEEHEAD_ID,
                 :NEW.FEEHEAD_NAME,
                 0,
                 'NM',
                 'N',
                 :NEW.ACTIVE_FLAG);       
   ELSIF UPDATING THEN
        UPDATE  dc_testmst
        SET TEST_NAME = NVL(:NEW.FEEHEAD_NAME,:OLD.FEEHEAD_NAME),
               ACTIVE_STATUS = NVL(:NEW.ACTIVE_FLAG, :OLD.ACTIVE_FLAG) 
        WHERE TEST_NO = :OLD.FEEHEAD_ID;
       
   ELSIF DELETING THEN
      DELETE       dc_testmst
      WHERE TEST_NO = :OLD.FEEHEAD_ID;
   END IF;
END;
/
ALTER TRIGGER "KYAMC_MCMS"."TRG_FEEHEAD" ENABLE;
